import { StyleSheet } from 'react-native';

export default StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
  },
  content: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
  textoBoasVindas: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#333',
  },
});
